import React, {Component} from 'react';
import TodoItem from "./TodoItem"
import todosData from "./todosData"

class App extends Component {

  render(){
    const item=todosData.map(i => <TodoItem key={i.id} it={i}/>)

    return (
      <div className="todo-list">
          {item}
      </div>
    )
  }
}

export default App;
